description:
Here you are, the full pack of Legends of Percevan.

This is one of my favorite childhood books, it has finally been released released in english, so grab it, and enjoy :) And remember to buy the books, theyre VERY reasonably priced at 20$ or less for a 160 page hardcover book :)

This is an all ages book, can safely give it to your kids, even if youre american :)


